import React, { Component } from 'react';
import { Tab, Tabs } from '@blueprintjs/core';
import { TabContent, TabPane } from 'reactstrap';
import Sidebar from '../../components/Sidebar';
import SidebarItem from '../../components/Sidebar/SidebarItem';
//import ProjectsManagerCard from './components/ProjectCard/ProjectsManagerCard';
//import SLACard from './components/SLACard/SLACard';
//import EmployeeCard from './components/EmployeeCard/EmployeeCard';

export default class Projects extends Component {
   state = {
      activeTabID: 1,
      selected: 'A'
   };
   handleTabChange = TabId => this.setState({ activeTabID: 1 });
   render() {
      const { selected } = this.state;
      return (
         <div>
            <Sidebar>
               <SidebarItem
                  icon='dashboard'
                  selected={selected === 'A'}
                  onClick={() => this.changeSelection('A')}
               />
               <SidebarItem
                  icon='time'
                  selected={selected === 'B'}
                  onClick={() => this.changeSelection('B')}
               />
            </Sidebar>
            <TabContent>
               <TabPane id='A'>
                  <Tabs id='1' onChange={this.handleTabChange} large>
                     <Tab
                        id='1'
                        title='ProjectManagerCard'
                        panel={<div>1</div>}
                     />
                     <Tab id='2' title='SLACard' panel={<div>3</div>} />
                     <Tab id='3' title='EmployeeCard' panel={<div>2</div>} />
                  </Tabs>
               </TabPane>
               <TabPane id='B'></TabPane>
            </TabContent>
         </div>
      );
   }
}
